text:
@이기택-w8x 아뇨 뭐 엮은 재판을 묻는게 아니라 어떤 생각을 가지신지 여쭈어본겁니다. 오바하지 마시길. 참고로 기소된 바는 없지만 조사는 하고 있습니다. 청탁을 위한 뇌물 수수로요. 그게 사실상 윤석열이랑 엮는 거죠. 표면상 인사권자나 결정권자는 윤석열이니까요?
 그리고 뇌물은 수수한 사람도 중요하지만 그 뇌물 수수가 끼친 영향도 평가를 해야합니다. 비록 아내가 받은게 맞을지언정 어쨋든 노무현의 사람에게 간 뇌물이기에 "포괄적 뇌물"로 볼 수 있는 여지가 존재했고 그거에 대한 조사와 법적 공방이 있던 겁니다. 즉, 아내가 받았다는게 증명된건 맞지만 노무현이 받지 않았다는건 증명된 적이 없어요.

 그렇기 때문에 저도 단정지어서 노무현이 잘못했다!라고 말할 수는 없는 노릇이지만 노무현 최측근이 그렇게 썩어빠졌는데 적어도 최측근 관리 못한 도의적인 책임이라도 있지 않을까요? 대한민국 대통령으로서 대한민국 정부와 대통령의 위상을 크게 떨어뜨린 사건들인데?

@이@이기택-w8x 일단 모르는 사람한테 반말 찍찍하는 그 싸가지 없는 태도는 고치시고요. 건방지네요 감히 ㅋㅋ
 이미 그 임기 종료 이틀 전에 청탁한 것 외에 여러차례 금품을 수수한 바가 있어서 그 논의는 무의미하다고 생각하고, 이상한건 금품을 전달한 사람들에게 물어볼 몫이지 노무현 일가가 그 시점에 금품을 받았다는 사실은 변함이 없어요. 오히려 이틀 전에 받은게 더 신기한거 아닌가요?
 그리고 대가성 청탁일수도 있겠죠? 이미 한 일에 대한 보상 명목으로 주는?

